INSERT INTO `cargos` VALUES (14,'3. Técnico(a)',1.5,'União e Cooperação; Disciplina; Dedicação; Consciência Crítica; Ótimo domínio e agilidade nas rotinas; Bom conhecimento da maioria das atividades; Ótima criatividade; Boa interação com o grupo; Iniciativa.',1),(15,'1. Aspirante',0.66,NULL,1),(16,'7. Gerente de Produção',6,'Redação intermediária; Boa habilidade em articular com todas as áreas do Iteva; Boa capacidade de absorver várias informações e concatená-las; Grande capacidade de motivação e liderança; Boa capacidade em estruturação de metas.',1),(17,'8. Gerente de Operações',8,'Bom domínio de redação; Grande habilidade em articular com todas as áreas do Iteva; Grande capacidade de absorver várias informações e concatená-las; Grande capacidade em estruturação de metas; Boa formação cultural.',1),(18,'9. Diretor de operações',10,'Bom conhecimento do segmento ao qual o Iteva está inserido; Boa capacidade de planejamento; Boa capacidade em articular com diversos segmentos da sociedade\r\nGrande agilidade em tomar decisões; Boa formação cultural.',1),(19,'2. Produtor',1,'Bom domínio e agilidade nas rotinas; Boa organização nos processos; Boa criatividade; Boa interação com seus coordenadores.\r\nIniciativa',1),(20,'4. Especialista',2,'Ótima manipulação da combinação de vários elementos; Boa capacidade de estruturação de informações e atividades; Boa capacidade em coordenação de grupos; Ótima interação com o grupo; Boa capacidade de organização',1),(21,'5. Supervisor',3,'Boa capacidade de realizar entendimentos; Grande conhecimento de sua especialidade (multimídia, financeiro, pedagogia, etc.); Grande capacidade de estruturação de informações e atividades; Boa capacidade em lidar com diversas coisas ao mesmo tempo; Grande conhecimento do grupo.',1),(22,'6. Coordenador',4,'Redação básica; Grande capacidade de realizar entendimentos; Grande capacidade de organização; Boa capacidade de motivação e liderança; Boa capacidade em cumprir de metas',1),(23,'10. Diretor executivo',10,'Grande conhecimento do segmento ao qual o Iteva está inserido; Grande capacidade de planejamento; Grande capacidade em articular com diversos segmentos da sociedade; Visão empreendedora; Grande formação cultural',1);
